% дата
d=[1:length(euro)];
% в зависимости от количества входных значений
% определяется и количество начальных значений в сети прямого
% распространения
h=[euro;brent;ar_usd];
% создание нейронной сети прямого распром
net=newff([minmax(h)],[10,7,1],{'tansig','tansig','purelin'},'trainlm');
% инициализация параметров нейронной сети
net=init(net);
% количество эпох
net.trainParam.epochs=200
% обучение нейронной сети
[net1,a,y,e]=train(net,h,usd);
an=sim(net1,h);
figure(1)
plot(d,usd,'b-',d,an,'g-')
legend('Actual United State dollar','Approximation')
xlabel('date')
ylabel('som')
